        注册登录
      </div>
      <div class="map" id="map"></div>
      <div @click="toNews" style="line-height: 500px;text-align: center;font-size: 25px;color: #fff;width: 10%;height: 100%;background: url('https://ss1.bdstatic.com/70cFvXSh_Q1YnxGkpoWK1HF6hhy/it/u=3216580012,3595411567&fm=26&gp=0.jpg');background-size: 100%;">
