<script>
    import AMap from 'AMap'
    export default {
        name: "index",
      data(){
          return {
            qulist:[],
          }
      },
      mounted(){
        this.gequ()


        this.MapInit()
      },
      methods:{
        toLogin(){
          this.$router.push("/login")
          console.log(22)
        },
        toNews(){
          this.$router.push("/detail/news")

        },

        MapInit () {
          let me = this
          AMap.plugin('AMap.DistrictSearch', function () {
            var districtSearch = new AMap.DistrictSearch({
              // 返回行政区边界坐标等具体信息
              extensions: 'all',
              // 设置查询行政区级别为 区
              level: 'district'
            })

            // 搜索所有省/直辖市信息
            districtSearch.search('天津', function(status, result) {
              var map = new AMap.Map('map', {
                resizeEnable: true,
                center: [result.districtList[0].center.R, result.districtList[0].center.Q],//地图中心点
                zoom: 10 //地图显示的缩放级别
              })
              var outer = [
                new AMap.LngLat(-360,90,true),
                new AMap.LngLat(-360,-90,true),
                new AMap.LngLat(360,-90,true),
                new AMap.LngLat(360,90,true),
              ];
              var holes = result.districtList[0].boundaries

              var pathArray = [
                outer
              ];
              pathArray.push.apply(pathArray,holes)
              var polygon = new AMap.Polygon( {
                pathL:pathArray,
                strokeColor: '#00eeff',
                strokeWeight: 1,
                fillColor: '#71B3ff',
                fillOpacity: 0.5
              });
              polygon.setPath(pathArray);
              map.add(polygon)

              me.qulist.forEach(item=>{
                var marker = new AMap.Marker({
                  position: item.value,
                  // offset: new AMap.Pixel(-10, -10),
                  icon: '//a.amap.com/jsapi_demos/static/demo-center/icons/poi-marker-default.png', // 添加 Icon 图标 URL
                  title: item.name
                });

                map.add(marker);
                marker.on("click",(x)=>{
                  // console.log(x.target.w.title)
                  me.$router.push({path:"/detail/detail_content",query:{id:x.target.w.title}})
                })
              })



            // 查询的
            })


          })



        // 函数的
        },

        // 各区
        gequ () {
          let me = this
          AMap.plugin('AMap.DistrictSearch', function () {
            var districtSearch = new AMap.DistrictSearch({
              // 返回行政区边界坐标等具体信息
              extensions: 'all',
              // 设置查询行政区级别为 区
              level: 'district'
            })

            // 搜索所有省/直辖市信息
            districtSearch.search('河东', function(status, result) {
              let holes = result.districtList[0]
              me.qulist.push({name:holes.name,value:holes.center})

              // 查询的
            })
            districtSearch.search('河西', function(status, result) {
              let holes = result.districtList[0]
              me.qulist.push({name:holes.name,value:holes.center})

              // 查询的
            })
            districtSearch.search('南开', function(status, result) {
              let holes = result.districtList[0]
              me.qulist.push({name:holes.name,value:holes.center})

              // 查询的
            })
            districtSearch.search('河北', function(status, result) {
              let holes = result.districtList[0]
              me.qulist.push({name:holes.name,value:holes.center})

              // 查询的
            })
            districtSearch.search('红桥', function(status, result) {
              let holes = result.districtList[0]
              me.qulist.push({name:holes.name,value:holes.center})

              // 查询的
            })
            districtSearch.search('和平', function(status, result) {
              let holes = result.districtList[0]
              me.qulist.push({name:holes.name,value:holes.center})

              // 查询的
            })
            districtSearch.search('津南', function(status, result) {
              let holes = result.districtList[0]
              me.qulist.push({name:holes.name,value:holes.center})

              // 查询的
            })
            districtSearch.search('西青', function(status, result) {
              let holes = result.districtList[0]
              me.qulist.push({name:holes.name,value:holes.center})

              // 查询的
            })
            districtSearch.search('东丽', function(status, result) {
              let holes = result.districtList[0]
              me.qulist.push({name:holes.name,value:holes.center})

              // 查询的
            })
            districtSearch.search('北辰', function(status, result) {
              let holes = result.districtList[0]
              me.qulist.push({name:holes.name,value:holes.center})

              // 查询的
            })

          })


          // 函数的
        }


        // methods的
      }
    }
</script>

